import React, {Component} from 'react';
import {levelData} from './data';

import './reset.css';

class App extends Component {
  state = {
    levelItems: levelData
  }

  render(){
    const {levelItems} = this.state
    return (
      <React.Fragment>
          <Nav 
            levelItems={levelItems}/>
      </React.Fragment>
    )
  }
}
export default App;
